import React, {Component} from 'react';
import './Loading.css'

class Loading extends Component {
    render() {
        let {isLoading} = this.props;
        var display = isLoading ? 'show' : 'hidden';
        return (
            <div className="bg-loading">
                <div className="loading"/>
            </div>
        );
    }
}

export default Loading;
